window.bookSummaryJSON = "<p>He's prince charming. Just not hers.&nbsp;</p> <p>I have a secret.&nbsp;</p> <p>I stole a heart, or rather a marriage contract.&nbsp;</p> <p>It wasn’t mine to own, to look at, or to even consider.&nbsp;</p> <p>But it was there for the taking, so I took it.&nbsp;</p> <p>Huge mistake.&nbsp;</p> <p>Ronan Astor is a nobility in this world.&nbsp;</p> <p>Arrogant player.&nbsp;</p> <p>Heartless bastard.&nbsp;</p> <p>Vicious prince.&nbsp;</p> <p>Now, he’s out to destroy me.&nbsp;</p> <p>What he doesn’t know is that I’m out to destroy him, too.&nbsp;</p> <p>My name is Teal Van Doren, and I’m where princes go to die.&nbsp;&nbsp;</p> <p><i>Vicious Prince </i>is part of Royal Elite series but could be listened to on its own. For better understanding of the world, you might want to listen to the previous books first. This is a mature new-adult work and contains situations that some listeners might find offensive or triggering.&nbsp;</p>"; 
